const github = '';
const discord = '';
const figma = '';
const insomnia = '';
const facebook = '';
const twitter = '';
const instagram = '';
const messenger = '';
const globe = '';
// const template = 'aaaa';

export default function getButtonTemplate(logo: string) {
  switch (logo) {
    case 'discord':
      return discord;
    case 'github':
      return github;
    case 'figma':
      return figma;
    case 'insomnia':
      return insomnia;
    case 'twitter':
      return twitter;
    case 'facebook':
      return facebook;
    case 'instagram':
      return instagram;
    case 'messenger':
      return messenger;
    default:
      return globe;
  }
}
